INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0.0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 0.0, "2015/12/17 15:00:00", 0, -363.0, 1, "キャル", 106001, 1, 7001, 0, 7, "2030/12/17 14:59:59", 1);
