INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0.0, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 0.0, "2015/12/17 15:00:00", 2104010, -363.0, 1, "シェフィ", 106401, 1, 13003, 0, 13, "2030/12/17 14:59:59", 2);
