INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0.0, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 0.0, "2015/12/17 15:00:00", 2104010, -363.0, 1, "シェフィ", 106401, 1, 16001, 0, 16, "2030/12/17 14:59:59", 2);
