INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (8.0, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 5.0, "2019/01/31 12:00:00", 0, -385.0, 2, "エリコ（バレンタイン）", 109001, 2, 24002, 10011, 24, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (8.0, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 10.11, "2019/01/31 12:00:00", 0, -385.0, 2, "エリコ（バレンタイン）", 109001, 3, 24003, 10011, 24, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (8.0, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 4.0, "2019/01/31 12:00:00", 0, -385.0, 2, "エリコ（バレンタイン）", 109001, 4, 24004, 10011, 24, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (8.0, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 6.0, "2019/01/31 12:00:00", 0, -385.0, 2, "エリコ（バレンタイン）", 109001, 5, 24005, 10011, 24, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0.0, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 0.0, "2019/01/31 12:00:00", 0, 0.0, 1, "エリコ（バレンタイン）", 109002, 6, 24006, 10011, 24, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0.0, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 0.0, "2019/01/31 12:00:00", 0, 0.0, 1, "エリコ（バレンタイン）", 109002, 7, 24007, 10011, 24, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0.0, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 0.0, "2019/01/31 12:00:00", 0, 0.0, 1, "エリコ（バレンタイン）", 109002, 8, 24008, 10011, 24, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0.0, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 0.0, "2019/01/31 12:00:00", 0, 0.0, 1, "エリコ（バレンタイン）", 109002, 9, 24009, 10011, 24, "2030/12/17 14:59:59", 1);
