INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0.0, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 0.0, "2015/12/17 15:00:00", 0, -371.5, 1, "アメス", 123001, 1, 46001, 0, 46, "2030/12/17 14:59:59", 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0.0, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", 0.0, "2015/12/17 15:00:00", 0, -416.5, 2, "シズル", 104901, 1, 47001, 0, 47, "2030/12/17 14:59:59", 2);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0.0, "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪", 9.32, "2015/12/17 15:00:00", 0, -416.5, 2, "リノ", 101101, 1, 47002, 0, 47, "2030/12/17 14:59:59", 1);
